export function getDay(string:string):number{
    const date = new Date(string)
    return date.getDate()
}
export function getMonth(string:string):string{
    const month = {
        0:'Jan',
        1:'Feb',
        2:'Mar',
        3:'Apr',
        4:'May',
        5:'Jun',
        6:'Jul',
        7:'Aug',
        8:'Sep',
        9:'Oct',
        10:'Nov',
        11:'Dec'

    }
    const date = new Date(string)
    console.log(date.getMonth().month)

    return '1'
}
